import React, { Component } from "react";
import { Col } from "antd";

export class About extends Component {
  render() {
    return (
      <Col span={8}>
        <div style={{color: "white", fontWeight: "bold", fontSize: "25px"}}>Name</div>
        <div style={{color: "white"}}>Choi Jong Sun(최종선)</div>
        <div style={{color: "white", fontWeight: "bold", fontSize: "25px"}}>Age</div>
        <div style={{color: "white"}}>28</div>
        <div style={{color: "white", fontWeight: "bold", fontSize: "25px"}}>Date of Birth</div>
        <div style={{color: "white"}}>1992.03.29</div>
        <div style={{color: "white", fontWeight: "bold", fontSize: "25px"}}>Nationality</div>
        <div style={{color: "white"}}>Korea</div>


      </Col>
    );
  }
}

export default About;
